import styled from "styled-components";

export const MercadoStyle = styled.div`

    background-image: linear-gradient(#D3D3D3, #808080);

    .container {
        margin: 0;
        width: 100vw;
        height: 100vh;
        overflow-x: hidden;

        justify-content: space-between;
    }

`
